import React, { Component } from 'react'

export class FetchTop10Players extends Component {
    constructor(props) {
        super(props)

        this.state = {
             projectList: []
        }
    }

    async fetchAll() {
        try{

        let response = await(fetch(this.props.websiteUrl + 'api/top10-players/'));
        let data = await response.json();
        this.setState({
            projectList: data
        })

        } catch (err){
            console.log(err)
        }

    }
    componentWillMount() {
        this.fetchAll()
    }
    render() {
        return (
            <div>
                {this.state.playerList.map(function(player, index){
                    return(
                    <div>{player.id} , {player.country}, {player.nickname}, {player.score} </div>
                        )
                })}
            </div>
        )
    }
}

export default FetchTop10Players
